            Assert.IsFalse(TestTimestamp("2017-01-01"));
            Assert.IsFalse(TestTimestamp("2017-01-01A23:59:59"));

            // TEST INTERVALS

            Assert.IsTrue(TestTimestamp("W127/T23:59:59"));
            Assert.IsTrue(TestTimestamp("W127/T23:59:59/T23:59:59"));
